import React, { Component } from 'react';

class PhotoSet extends Component {
  render() {
    const project = this.props.project;

    return (
      <div
      className="PhotoSet"
      id={project.id}
      >
        <h2>{project.title}</h2>
        {this.renderPhotos(project.photos)}
      </div>
    );
  }

  //////////////////////


  renderPhotos = (photos) => {
    return (
      photos.map(p => {
        return <img src={p} key={p} />
      })
    )
  }
}

export default PhotoSet;
